function Contact(props){
    <div className="contact">
        <h1>Contact
            <p1>Email - {props.email}</p1>
            <p1>Cell - {props.contactnumber}</p1>
            <p1>Mail - {props.mail}</p1>
        </h1>
    </div>
};

export default Contact;
